/****** Object:  StoredProcedure [dbo].[sp_ton_tai_nv_du_an]    Script Date: 1/3/24 10:52:17PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE proc [dbo].[sp_ton_tai_nv_du_an] @id_project char(31), @id_nv char(31)
as
begin
    if EXISTS (
        select *
        from ( 
            select * from NHAN_VIEN_DU_AN where ID_DA = @id_project and NGAY_KET_THUC_NVDA is null
        ) as DA
        inner join DE_XUAT_DU_AN AS DXDA on DXDA.ID_DXDA = DA.ID_DXDA
        inner join NHAN_VIEN_PHONG_BAN as NVPB on NVPB.ID_NVPB = DXDA.ID_NVPB
        inner join (select * from NHAN_VIEN where ID_NV = @id_nv) as NV on NV.ID_NV = NVPB.ID_NV
    )
    return 1

    return 0
end




